/**
 * Declaração Única de Importação - Intervenientes Privados
 *
 * <p><h3>Duimp - Declara&ccedil;&atilde;o &Uacute;nica de Importa&ccedil;&atilde;o</h3>  <h4>Introdu&ccedil;&atilde;o</h4>  <p>A API da Declara&ccedil;&atilde;o &Uacute;nica de Importa&ccedil;&atilde;o (Duimp) , reunir&aacute; todas as informa&ccedil;&otilde;es de natureza aduaneira, administrativa, comercial, financeira, tribut&aacute;ria e fiscal pertinentes ao controle das importa&ccedil;&otilde;es pelos &oacute;rg&atilde;os competentes da Administra&ccedil;&atilde;o P&uacute;blica Brasileira na execu&ccedil;&atilde;o de suas atribui&ccedil;&otilde;es legais.</p>  <p>A entrega das APIs de registro, retifica&ccedil;&atilde;o e consulta de Duimp contribui para o aumento da utiliza&ccedil;&atilde;o da Duimp, bem como proporciona mais agilidade no processo de importa&ccedil;&atilde;o para as grandes empresas que j&aacute; fazem uso de sistemas pr&oacute;prios ou terceirizados para o preenchimento e acompanhamento do fluxo das importa&ccedil;&otilde;es.</p>  <p>Outro importante avan&ccedil;o da API &eacute; a notifica&ccedil;&atilde;o do avan&ccedil;o do processo de registro/retifica&ccedil;&atilde;o e mudan&ccedil;a de situa&ccedil;&atilde;o da Duimp at&eacute; seu desembara&ccedil;o, possibilitando maior dom&iacute;nio sobre o processo de despacho das declara&ccedil;&otilde;es de importa&ccedil;&atilde;o.</p>  <h4>URLs de Acesso</h4>  <p>Para utilizar os servi&ccedil;os dispon&iacute;veis nessa API deve-se seguir o seguinte padr&atilde;o de URL:</p>  <p><em>https://{ambiente}/duimp-api/api/{servi&ccedil;o}</em></p>  <p>Onde, em <strong>{ambiente}</strong> deve-se informar o ambiente desejado dentre os ambientes dispon&iacute;veis na tabela abaixo e em <strong>{servi&ccedil;o}</strong> utilizar a URI do servi&ccedil;o desejado.</p>  <style type=\"text/css\"> .tg  {border-collapse:collapse;border-color:#bbb;border-spacing:0;width: 604px;} .tg td{background-color:#E0FFEB;border-color:#bbb;border-style:solid;border-width:1px;color:#594F4F;   font-family:Arial, sans-serif;font-size:14px;overflow:hidden;padding:10px 5px;word-break:normal;} .tg th{background-color:#9DE0AD;border-color:#bbb;border-style:solid;border-width:1px;color:#493F3F;   font-family:Arial, sans-serif;font-size:14px;font-weight:normal;overflow:hidden;padding:10px 5px;word-break:normal;} .tg .tg-cabecalho{text-align:left;vertical-align:top;} .tg .tg-corpo{border-color:inherit;text-align:left;vertical-align:top;} </style>  <table class=\"tg\" style=\"width: 604px;\"> <thead>   <tr>     <th class=\"tg-cabecalho\"><span style=\"font-weight:bold\">Nome do Ambiente</span></th>     <th class=\"tg-cabecalho\"><span style=\"font-weight:bold\">URL de acesso</span></th>   </tr> </thead> <tbody>   <tr>     <td class=\"tg-corpo\">Ambiente de Validação das Empresas</td>     <td class=\"tg-corpo\">val.portalunico.siscomex.gov.br</td>   </tr>   <tr>     <td class=\"tg-corpo\">Ambiente de Produção</td>     <td class=\"tg-corpo\">portalunico.siscomex.gov.br</td>   </tr> </tbody> </table>  <p>&nbsp;</p>  <p><strong>Exemplo:</strong> Para o servi&ccedil;o &quot;Consulta dos dados gerais da vers&atilde;o vigente de uma Duimp&quot; a URI &eacute; &quot;ext/duimp/{numero}/{versao}&quot;.</p>  <p>Logo, abaixo temos um exemplo de URL completa considerando o ambiente de Valida&ccedil;&atilde;o, consumindo este servi&ccedil;o</p>  <p><em>https://val.portalunico.siscomex.gov.br/duimp-api/api/ext/duimp/20BR00001001899/1</em></p>  <h4>As opera&ccedil;&otilde;es que podem ser gerenciadas pela API do sistema s&atilde;o:</h4>  <h4>Opera&ccedil;&otilde;es para Registro:</h4> <ul>  <li>Salvar dados gerais da Duimp para registro</li>  <li>Salvar dados gerais da Duimp retifica&ccedil;&atilde;o</li>  <li>Atualizar dados gerais da Duimp para registro ou retifica&ccedil;&atilde;o </li>  <li>Salvar dados dos itens da Duimp para registro ou retifica&ccedil;&atilde;o</li>  <li>Atualizar dados dos itens da Duimp para registro ou retifica&ccedil;&atilde;o</li>  <li>Excluir dados gerais e itens da Duimp para registro ou retifica&ccedil;&atilde;o</li>  <li>Excluir dados dos itens da Duimp para registro ou retifica&ccedil;&atilde;o</li>  <li>Consultar valores calculados da Duimp</li>  <li>Consultar valores calculados dos itens da Duimp</li>  <li>Solicitar o diagn&oacute;stico da Duimp para registro ou retifica&ccedil;&atilde;o</li>  <li>Solicitar o registro da Duimp para registro ou retifica&ccedil;&atilde;o</li>  <li>Recuperar modelo dos dados gerais da Duimp para utilizar em novo registro ou retifica&ccedil;&atilde;o</li>  <li>Recuperar modelo dos dados dos itens da Duimp para utilizar em novo registro ou retifica&ccedil;&atilde;o</li>  <li>Recuperar modelo da solicita&ccedil;&atilde;o de registro da Duimp para utilizar em novo registro ou retifica&ccedil;&atilde;o</li> </ul>  <h4>Opera&ccedil;&otilde;es de Consulta:</h4>  <ul>  <li>Consultar os dados gerais da Duimp j&aacute; registrada</li>  <li>Consultar os dados de um item espec&iacute;fico da Duimp j&aacute; registrada</li>  <li>Consultar os dados de uma faixa de itens da Duimp j&aacute; registrada</li>  <li>Consultar a versão vigente de uma Duimp j&aacute; registrada</li>  <li>Consultar a chave de acesso por importador e per&iacute;odo</li>  <li>Consultar a chave de acesso por Duimp</li> </ul>  <p><b>Obs:</b> Todas as operações contam com uma descrição geral da operação abaixo da url, além da descrição resumida exibida ao seu lado.</p>  <h4>Integrações</h4>  <p>A Duimp &eacute; um sistema integrador que interage com com diversos outros sistemas da fam&iacute;lia Pucomex, al&eacute;m de alguns sistemas da fam&iacute;lia Siscomex, relacionados abaixo:</p>  <ul>     <li>         <h4>Sistema Siscomex Carga</h4>         <ul>             <li><strong>Produ&ccedil;&atilde;o:</strong> <a href=\"https://www4.receita.fazenda.gov.br/g33159/jsp/logon.jsp?ind=11\">https://www4.receita.fazenda.gov.br/g33159/jsp/logon.jsp?ind=11</a></li>         </ul>     </li>     <li>         <h4>Sistemas do Portal &Uacute;nico de Com&eacute;rcio Exterior</h4>         <ul>    <li>Sistema Anexa&ccedil;&atilde;o Eletr&ocirc;nica (<a href=\"https://docs.portalunico.siscomex.gov.br/swagger/edocex.html\">https://docs.portalunico.siscomex.gov.br/swagger/edocex.html</a>)</li>    <li>Sistema Cat&aacute;logo de Produtos (<a href=\"https://docs.portalunico.siscomex.gov.br/swagger/catp.html\">https://docs.portalunico.siscomex.gov.br/swagger/catp.html</a>)</li>    <li>Sistema Cadastro de Atributos (<a href=\"https://val.portalunico.siscomex.gov.br/cadatributos/api/atributo-ncm/download/json\">https://val.portalunico.siscomex.gov.br/cadatributos/api/atributo-ncm/download/json</a> ou <a href=\"https://portalunico.siscomex.gov.br/cadatributos/api/atributo-ncm/download/json\">https://portalunico.siscomex.gov.br/cadatributos/api/atributo-ncm/download/json</a>)</li>    <li>Sistema Tratamento Administrativo e LPCO (<a href=\"https://docs.portalunico.siscomex.gov.br/swagger/talpco.html\">https://docs.portalunico.siscomex.gov.br/swagger/talpco.html</a>)</li>    <li>Sistema Tabelas Aduaneiras (<a href=\"https://docs.portalunico.siscomex.gov.br/pages/tabelas_dominio/\">https://docs.portalunico.siscomex.gov.br/pages/tabelas_dominio/</a>)</li>    <li>Sistema Tratamento Tribut&aacute;rio (<a href=\"https://docs.portalunico.siscomex.gov.br/swagger/ttce.html\">https://docs.portalunico.siscomex.gov.br/swagger/ttce.html</a>)</li>         </ul>     </li> </ul>  <h3>Fluxos de utiliza&ccedil;&atilde;o da API</h3> <h4>Fluxo M&iacute;nimo</h4> <img src=\"data:image/png;base64,\" alt=\"Fluxo 1\">  <h4>Fluxo Simplificado</h4> <img src=\"data:image/png;base64,\" alt=\"Fluxo 2\">  <h4>Fluxo da Consulta</h4> <img src=\"data:image/png;base64,\" alt=\"Fluxo 3\">  <h4>Fluxos Alternativos</h4> <img src=\"data:image/png;base64,\" alt=\"Fluxo 4\">       
 *
 */
@Path("/")
@Api(value = "/", description = "")
public interface ChaveDeAcessoApi  {

    /**
     * Recuperar chave de acesso de lista de Duimp a partir de um importador.
     *
     * Use esta funcionalidade para recuperar os dados relativos a chave de acesso do importador em um determinado período.
     *
     */
    @GET
    @Path("/ext/duimp/chaves-acesso/importadores/{ni-importador}")
    @Produces({ "application/json" })
    @ApiOperation(value = "Recuperar chave de acesso de lista de Duimp a partir de um importador.", notes = "Use esta funcionalidade para recuperar os dados relativos a chave de acesso do importador em um determinado período.", tags={ "Chave de acesso" })
    @ApiResponses(value = {
        @ApiResponse(code = 200, message = "Operação realizada com sucesso", response = DuimpChaveCover.class, responseContainer = "List"),
        @ApiResponse(code = 401, message = "Usuário não autenticado ou autenticação inválida"),
        @ApiResponse(code = 403, message = "Usuário não tem permissão de acesso ao recurso"),
        @ApiResponse(code = 404, message = "Recurso não encontrado"),
        @ApiResponse(code = 422, message = "Erro(s) de validação da camada de negócio", response = RespostaApiErro.class),
        @ApiResponse(code = 500, message = "Erro interno no servidor") })
    public Response buscarChavesPorImportador(@ApiParam(value = "NI do importador.",required=true) @PathParam("ni-importador") String niImportador, @NotNull @ApiParam(value = "Data inicial da pesquisa.",required=true)  @QueryParam("data-inicio") String dataInicio, @NotNull @ApiParam(value = "Data final da pesquisa.",required=true)  @QueryParam("data-termino") String dataTermino, @ApiParam(value = "JSON Web Token (JWT) contendo as informações do usuário. Este token é recuperado no parâmetro Set-Token no response da autenticação" ,required=true)@HeaderParam("Authorization") String authorization, @ApiParam(value = "Token de prevenção contra ataques CSRF. Este token é recuperado no parâmetro X-CSRF-Token no response da autenticação" ,required=true)@HeaderParam("X-CSRF-Token") String xCSRFToken, @ApiParam(value = "", defaultValue="0") @DefaultValue("0") @QueryParam("offset") Object offset, @ApiParam(value = "", defaultValue="100") @DefaultValue("100") @QueryParam("limit") String limit);

    /**
     * Recuperar as chaves de acesso de uma lista de Duimp.
     *
     * Use esta funcionalidade para recuperar os dados relativos a chave de acesso para uma lista de Duimp.
     *
     */
    @GET
    @Path("/ext/duimp/chaves-acesso")
    @Produces({ "application/json" })
    @ApiOperation(value = "Recuperar as chaves de acesso de uma lista de Duimp.", notes = "Use esta funcionalidade para recuperar os dados relativos a chave de acesso para uma lista de Duimp.", tags={ "Chave de acesso" })
    @ApiResponses(value = { 
        @ApiResponse(code = 200, message = "Operação realizada com sucesso", response = RespostaApiBuscaChave.class),
        @ApiResponse(code = 207, message = "Operação com múltiplos resultados. Resultados individuais devem ser observados no corpo da resposta da requisição", response = RespostaApiBuscaChave.class),
        @ApiResponse(code = 401, message = "Usuário não autenticado ou autenticação inválida"),
        @ApiResponse(code = 403, message = "Usuário não tem permissão de acesso ao recurso"),
        @ApiResponse(code = 404, message = "Recurso não encontrado"),
        @ApiResponse(code = 422, message = "Erro(s) de validação da camada de negócio", response = RespostaApiErro.class),
        @ApiResponse(code = 500, message = "Erro interno no servidor") })
    public Response buscarChavesPorListaDuimp( @NotNull @ApiParam(value = "Número da DUIMP. Para cada DUIMP a ser consultada, repetir este parâmetro.",required=true)  @QueryParam("numero-duimp") List<String> numeroDuimp, @ApiParam(value = "JSON Web Token (JWT) contendo as informações do usuário. Este token é recuperado no parâmetro Set-Token no response da autenticação" ,required=true)@HeaderParam("Authorization") String authorization, @ApiParam(value = "Token de prevenção contra ataques CSRF. Este token é recuperado no parâmetro X-CSRF-Token no response da autenticação" ,required=true)@HeaderParam("X-CSRF-Token") String xCSRFToken);
}

